import React, { Component } from 'react'

// CSS
import '../css/App.css'
import '../css/Resume.css'
import WOW from 'wowjs';

// IMAGES
import LinkedIn from '../Images/LinkedIn.png';
import Email from '../Images/email.png';
import GitHub from '../Images/github.png';
import LambdaStamp from '../Images/LambdaStamp.png'

export default class Footer extends Component {

    state = {

        active: false

    }

    toGitHub = () => {

        window.location.href = 'https://github.com/MaxGunter99'

    };

    toLinkedIn = () => {

        window.location.href = 'https://www.linkedin.com/in/michael-gunter-5383a0181/'

    };

    toEmail = () => {

        window.location.href = "mailto:Michael.Alex.Gunter@gmail.com";

    };

    render() {

        return (

            <footer>

                <img src={LambdaStamp} alt='LambdaStamp' className = 'LambdaStamp' />

                <div className = 'Connect'>
                    <h1>Michael Gunter</h1>

                    <div>
                        <h3>GitHub</h3>
                        <img src={GitHub} alt='FooterImage' className = 'FooterImage'onClick={ () => this.toGitHub() } />
                    </div>
                    <div>
                        <h3>LinkedIn</h3>
                        <img src={LinkedIn} alt='FooterImage' className = 'FooterImage' onClick={ () => this.toLinkedIn() } />
                    </div>
                    <div>
                        <h3>Email</h3>
                        <img src={GitHub} alt='FooterImage' className = 'FooterImage'onClick={ () => this.toGitHub() } />
                    </div>
                    <img src={Email} alt='FooterImage' className = 'FooterImage'onClick={ () => this.toEmail() } />
                </div>

            </footer>

        )
    }
}
